const fetch = require('node-fetch');       

function deleteC(query,cb) {
    return fetch(`http://localhost/api/borra?q=${query}`,{method: 'DELETE'})
        .then(res => res.text())
        .then(cb);
   }
  
const ClientDelete = { deleteC };
export default ClientDelete;
